import Heading from "./components/Heading";
import ToDoList from "./components/ToDoList";

function App() {
  return (
    <div className="container py-16 px-6 h-6/12 mx-auto bg-[#ffe4e6]">
      <Heading />
      <ToDoList />
    </div>
  );
}

export default App;
